import React from "react";
import PostPreview from "./post-preview";
import Post from "../types/post";
import CMS from "../types/cms";
type Props = {
  posts: CMS[];
};

const MoreStories: React.FC<Props> = ({ posts }) => {
  return (
    <section>
      <div>
        {posts.map((post) => (
          <PostPreview
            key={post.contents[0].slug}
            title={post.contents[0].title}
            date={post.contents[0].date}
            slug={post.contents[0].slug}
            excerpt={post.contents[0].excerpt}
          />
        ))}
      </div>
    </section>
  );
};

export default MoreStories;
